import Header from './Header';
import Newsletter from './Newsletter';
import Footer from './Footer';
import './style.scss'

const Layout = (props) => {
	// console.log(props.data)
	return (
		<>
			<Header />
			{props.children}
			<Newsletter />
			<Footer />
		</>
	)
};

export default Layout;
